import React from "react";

import Button from '@material-ui/core/Button';
import DeleteIcon from '@mui/icons-material/Delete';

const ListComp=(props)=>{
    [line,changeline]=useState(false);
    const change=()=>{
          changeline(true);
    }
    return (
    <>
     <Button className="btn" variant="contained" color="primary" onClick={change}>
        <DeleteIcon className="delete"></DeleteIcon>
     </Button>
    {line} ? <li style={{textDecoration:"line-through"}}>{props.text}</li> : <li style={{textDecoration:"line"}}>{props.text}</li>
    </>
    );
    
}
export default ListComp;
